import React from 'react';
import { SidebarRoutes } from './SidebarRoutes';
import { DivGeral } from './components/styles';

// Cabeçalho básico
const Header = () => {
    const headerStyle = {
        backgroundColor: '#1c2424',
        height: '60px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        color: 'white',
        fontWeight: 'bold',
    };

    return (
        <div style={headerStyle}>
            Meu Cabeçalho
        </div>
    );
};

function App() {
    return (
        <DivGeral style={{ height: '100vh', display: 'flex' }}>
        {/* Adicione o cabeçalho aqui */}
        <Header />
        <SidebarRoutes />
    </DivGeral>
  );
}

export default App;
